            initialize: function (options) {

                L.Util.setOptions(this, options);

            },
            onAdd: function (map) {
                this._map = map;

                var graticule = this;

                    zoom = map.getZoom();

                var interval = this.options.interval;

                var latLines = [];

                        interactive: false,

                        }).addTo(this);

                    ], {

                        interactive: false,
